import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="App-form">
          <form>
            <label>
              Text:
              <textarea type="text" name="text" ></textarea>
            </label>
            <label>
              Word
            </label>
            <input type="submit" value="Submit" />
          </form>
        </p>
      </header>
    </div>
  );
}

export default App;
